import React from "react";

function App() {
    fetch('https://jsonplaceholder.typicode.com/posts').then((data) => {
        if(data.status === 200){
            return data.json();
        }
        else {
            console.error("ceva nu e ok")
        }
        console.log(data)
    }).then((info) => {
        console.log(info)
    })
}

export default App()
